'use strict';

var randu = require( '@stdlib/math/base/random/randu' );
var cdf = require( './../lib' );

var k;
var x;
var y;
var i;

for ( i = 0; i < 20; i++ ) {
	x = randu() * 10.0;
	k = randu() * 10.0;
	y = cdf( x, k );
	console.log( 'x: %d, k: %d, F(x;k): %d',
		x.toFixed( 4 ),
		k.toFixed( 4 ),
		y.toFixed( 4 )
	);
}
